==简介==
本模板将《[[少女与战车]]》官方世界观设定中登场的其中几艘学院舰的图片配以文字做介绍。当用户输入学院名时，相应的学院舰名会以{{Color|Yellow|'''黄色加粗字体'''}}强调出来。
==用法==
<pre>{{Gupships|学院舰名（不填时所有学院舰名以白色常规字体显示）|float=图片的浮动（left为左，Right为右，none为无，默认值：none。可不填）}}</pre>
==举例==
<pre>{{Gupships}}</pre>
{{Gupships}}
<pre>{{Gupships|大洗}}</pre>
{{Gupships|大洗}}
==对应的学院及其名称==
所有学院名称由[[模块:少女与战车:团体名称|少女与战车:团体名称]]模块生成，该模块会截取用户输入的关键字，从中取出有效关键字并生成组织名称，再由本模板将选中的学院舰的名称强调出来。
以下为全部学院全部名称一览，'''黑体字部分'''为模块获取的组织名称关键字，也是用户需要输入的最短的组织名称代码（英语不区分大小写），当用户输入这些关键字后，即便其输入的学院名称有细微的差别也不会影响模板识别用户输入的信息（比如不论用户输入“大洗女子学园”还是“大洗女子学院”，模板都会将大洗学院舰的名称用{{Color|Yellow|'''黄色加粗字体'''}}强调出来。

